    return fact ** n

def fix_spaces(text):
    new_text = []
    i = 0
    while i < len(text):
        if text[i] == " ":
            # Count consecutive spaces
            count = 0
            while i + count < len(text) and text[i + count] == " ":
                count += 1
            # Determine replacement
            if count > 2:
                new_text.append("-")
            elif count > 0:
                new_text.append("_" * count)
            else:
                new_text.append(text[i])
            i += count
        else:
            new_text.append(text[i])
            i += 1
    return "".join(new_text)

def sum_squares(lst):
    result = []
    for i, num in enumerate(lst):
        if i % 3 == 0:
            result.append(num ** 2)
        elif i % 3 == 1:
            result.append(num ** 3)
        else:
            result.append(num)
    return sum(result[1::2])  # Sum every other element starting from index 1

def words_in_sentence(sentence):
    new_lst = []
    for word in sentence.split():
        word_len = len(word)
        is_valid = True
        # Check for perfect divisors in range [2, word_len - 1]
        for i in range(2, word_len):
            if word_len % i == 0:
                is_valid = False
                break
        # Add word if valid or length is 2
        if is_valid or word_len == 2:
            new_lst.append(word)
    return " ".join(new_lst)

