def Strongest_Extension(class_name, extensions):
    if not extensions:
        return class_name

    strong = extensions[0]
    my_val = len([x for x in extensions[0] if x.isalpha() and x.isupper()]) - len([x for x in extensions[0] if x.isalpha() and x.islower()])

    for s in extensions:
        current_val = len([x for x in s if x.isalpha() and x.isupper()]) - len([x for x in s if x.isalpha() and x.islower()])
        if current_val > my_val:
            strong = s
            my_val = current_val

    return f"{class_name}.{strong}"

